module Bands
using DSP
export generateband,ccir,edge,a_wtd,c_wtd,generateband_verify,filter_verify
const G=10^(3/10)
const f_r=1000

#class 1 frequency band
const attenuation_1=[-0.4 0.4;-0.4 0.5;-0.4 0.7;-0.4 1.4;16.6 Inf;40.5 Inf;60 Inf;70 Inf];
const attenuation_2=[-0.6 0.6;-0.6 0.7;-0.6 0.9;-0.4 1.7;15.6 Inf;39.5 Inf;54 Inf;60 Inf];
const octave_band=[1,G^(1/8),G^(1/4),G^(3/8),G,G^2,G^3,G^4];

function center(x::Int64,b::Int64)
    if iseven(b)
        return f_r*(G^((2*x+1)/(2*b)))
    else
        return f_r*(G^(x/b))
    end
end

function lower(x::Int64,b::Int64)
    temp=center(x,b)
	scaled=temp*G^(-1/(2*b))
	return scaled
end

function upper(x::Int64,b::Int64)
	temp=center(x,b)
	scaled=temp*G^(1/(2*b))
	return scaled
end

function edge(b::Int64,h_frequency::Real=20000.0,l_frequency::Real=20.0)
i=1
d=-1
x=0
if h_frequency>=1000
	c=center(0,b)
		while c<=h_frequency
			i+=1
			c=upper(i,b)
		end

		x=center(0,b)

		while l_frequency<=c
			d-=1
			c=lower(d,b)
		end

		i=i
		d=d

		temp=(*).(sign.(LinRange(d,i,(i-d)+1)),abs.(LinRange(d,i,(i-d)+1)))
		temp=round.(temp)
		temp=Int64.(temp)

		return temp
	else
		error("Highest Frequency must be than greater or equal to 1kHz")
	end

end

function acceptance_adjuster(x::Float64,b::Int64)
	if (b>1)
		ratio=(G^(1/(2*b))-1)/(G^(1/2)-1)
		scaled=ratio*(x-1.0)
		scaled=1+scaled
		return scaled
	else
		return x
	end
end

function acceptance_adjuster(x::Float64)
	return x
end


function generateband(bands::Int64,samplerate::Real,h_frequency::Real=20000.0,l_frequency::Real=20.0)
	if h_frequency>(samplerate/2)
		h_frequency=(samplerate/2)
		edgez=edge(bands,h_frequency,l_frequency)
		centerz=center.(edgez,bands)
		centerz_pow=log.(10,centerz)
		centerz_pow=floor.(centerz_pow)
		centerz_pow=(^).(10,centerz_pow)
		centerz_right=(/).(centerz,centerz_pow)
		center_right=round.(centerz_right,digits=2)
		centerz=(*).(center_right,centerz_pow)
	else
		edgez=edge(bands,h_frequency,l_frequency)
		centerz=center.(edgez,bands)
		centerz_pow=log.(10,centerz)
		centerz_pow=floor.(centerz_pow)
		centerz_pow=(^).(10,centerz_pow)
		centerz_right=(/).(centerz,centerz_pow)
		center_right=round.(centerz_right,digits=2)
		centerz=(*).(center_right,centerz_pow)
	end

	#check if band bound is greater than nyquist
	if upper(edgez[end],bands)>(samplerate/2)
		low_bw=lower.(edgez[1:(end-1)],bands)
		upp_bw=upper.(edgez[1:(end-1)],bands)

		#now filter build filter
		band_fil=Bandpass.(low_bw,upp_bw,fs=samplerate)
		nyquist_fil=Highpass(lower(edgez[end],bands),fs=samplerate)
		all_fil=vcat(band_fil,nyquist_fil)
		all_fil=map(x->digitalfilter(x,Elliptic(20,0.4,70)),all_fil)

	else
		low_bw=lower.(edgez,bands)
		upp_bw=upper.(edgez,bands)

		#now filter build filter
		band_fil=Bandpass.(low_bw,upp_bw,fs=samplerate)
		all_fil=band_fil
		all_fil=map(x->digitalfilter(x,Elliptic(20,0.4,70)),all_fil)

	end

	return (all_fil,centerz,low_bw,upp_bw)

end

function generateband_verify(bands::Int64,samplerate::Real,h_frequency::Real=20000.0,l_frequency::Real=20.0)
	if h_frequency>(samplerate/2)
		h_frequency=(samplerate/2)
		edgez=edge(bands,h_frequency,l_frequency)
		centerz=center.(edgez,bands)
	else
		edgez=edge(bands,h_frequency,l_frequency)
		centerz=center.(edgez,bands)
	end

	#check if band bound is greater than nyquist
	if upper(edgez[end],bands)>(samplerate/2)
		low_bw=lower.(edgez[1:(end-1)],bands)
		upp_bw=upper.(edgez[1:(end-1)],bands)

		#now filter build filter
		band_fil=Bandpass.(low_bw,upp_bw,fs=samplerate)
		nyquist_fil=Highpass(lower(edgez[end],bands),fs=samplerate)
		all_fil=vcat(band_fil,nyquist_fil)
		all_fil=map(x->digitalfilter(x,Elliptic(4,0.4,70)),all_fil)

	else
		low_bw=lower.(edgez,bands)
		upp_bw=upper.(edgez,bands)

		#now filter build filter
		band_fil=Bandpass.(low_bw,upp_bw,fs=samplerate)
		all_fil=band_fil
		all_fil=map(x->digitalfilter(x,Elliptic(4,0.4,70)),all_fil)
	end


	return (all_fil,centerz)

end


function filter_verify(bands::Int64,samplerate::Real,class::Int64=1,h_frequency::Real=20000.0,l_frequency::Real=20.0)
	nyquist_f=samplerate/2
	filter_tup=generateband_verify(bands,samplerate,h_frequency,l_frequency)
	bandnum=length(filter_tup[1])
	scaled_limit=acceptance_adjuster.(octave_band,bands)
	normalize_freq=vcat((/).(1,scaled_limit[end:-1:2]),scaled_limit)


	if class==1
		att_top=vcat(attenuation_1[end:-1:2,1],attenuation_1[:,1])
		att_bot=vcat(attenuation_1[end:-1:2,2],attenuation_1[:,2])
		att=hcat(att_top,att_bot)

	elseif class==2
		att_top=vcat(attenuation_2[end:-1:2,1],attenuation_2[:,1])
		att_bot=vcat(attenuation_2[end:-1:2,2],attenuation_2[:,2])
		att=hcat(att_top,att_bot)

	else
			error("Octave Band Filter Class Undefined")
	end

	verification_val=0
	#println("The Number of ", bands," Octave Bands : ",bandnum)
	for filter_num in 1:1:bandnum
		center=filter_tup[2][filter_num]
		test_filter=filter_tup[1][filter_num]
		test_frequency=(*).(center,normalize_freq)
		test_frequency=filter(x->nyquist_f>=x,test_frequency)
		test_frequency=(*).(((2*π)/samplerate),test_frequency)
		tf_num=length(test_frequency)
		temp_var=0
		for tfreq in 1:tf_num
			level=freqresp(test_filter,test_frequency[tfreq])
			level=abs(level)
			#the negative sign is because this is attenuation not gain anymore
			att_level=amp2db(level)
			att_level=round(att_level,digits=1)
			att_level=-att_level
			att_check=(att[tfreq,2]>=att_level)&&(att_level>=att[tfreq,1])
			if !att_check
				println(att[tfreq,2]," >= ",att_level," >= ",att[tfreq,1],", Center (Hz): ",center," Verfication (Hz): ",test_frequency[tfreq]*((2*π)\samplerate))
			else
			end
			temp_var=temp_var+att_check
		end

		verification_val=verification_val+(temp_var/tf_num)

	end

	if verification_val==Float64(bandnum)
			return true
	else
			println("Correct (%) : ",100*(verification_val/bandnum))
			return false
	end

end

function ccir(samplerate::Float32)

	if samplerate==44100
		return ccir_441k
	elseif samplerate==48000
		return ccir_48k
	elseif samplerate==96000
		return ccir_96k
	else
		return error("CCIR is not defined at this samplerate")
	end

end

function a_wtd(samplerate::Float32)

	if samplerate==44100
		return awtd_441k
	elseif samplerate==48000
		return awtd_48k
	elseif samplerate==96000
		return awtd_96k
	else
		return error("A-weighting is not defined at this samplerate")
	end

end

function c_wtd(samplerate::Float32)

	if samplerate==44100
		return cwtd_441k
	elseif samplerate==48000
		return cwtd_48k
	elseif samplerate==96000
		return cwtd_96k
	else
		return error("C-weighting is not defined at this samplerate")
	end

end


